import React, {Component} from 'react';
import {Todo} from './Todo'

export class TodoList extends Component {

    render() {
            const list = this.props.todoList.map((todo,index) =>
                <li key={index}>
                   {todo.text}
                 </li>
            );
            return (
                <tr> {list} </tr>
            );
        }
}
export default TodoList;
